import React from 'react';
import { Carousel, List, Typography, Divider } from 'antd';
import AppLayout from '../components/Applayout';

const data = [
  'Racing car sprays burning fuel into crowd.',
  'Japanese princess to wed commoner.',
  'Australian walks 100km after outback crash.',
  'Man charged over missing wedding girl.',
  'Los Angeles battles huge wildfires.',
];

const Main = () => {
  return (
    <AppLayout>
      <Carousel style={{ textAlign: 'center', height: '160px', lineHeight: '160px', backgroundColor: '#364d79', overflow: 'hidden', margin: '20px 20px' }} effect="fade">
        <div>
          <h3 style={{ color: '#fff' }}>1</h3>
        </div>
        <div>
          <h3 style={{ color: '#fff' }}>2</h3>
        </div>
        <div>
          <h3 style={{ color: '#fff' }}>3</h3>
        </div>
        <div>
          <h3 style={{ color: '#fff' }}>4</h3>
        </div>
      </Carousel>
      <Divider orientation="left">Default Size</Divider>
      <div style={{ display: 'flex', flexDirection: 'row' }}>
        <List
          header={<div>Header</div>}
          footer={<div>Footer</div>}
          bordered
          dataSource={data}
          renderItem={item => (
            <List.Item>
              <Typography.Text mark>[ITEM]</Typography.Text> {item}
            </List.Item>
          )}
        />
        <img src='https://ant.design' alt="aa" />
      </div>
    </AppLayout>
  );
};

export default Main;
